def threeSum(nums):
    a = set()
    b = set()
    c = set()
    resSet = set()
    res = []

    for i in range(len(nums)):
        if nums[i] in a:
            continue

        a.add(nums[i])

        for j in range(i+1, len(nums)):
            # if nums[j] in b:
            #     continue

            # b.add(nums[j])

            for k in range(j+1, len(nums)):
                # if nums[k] in c:
                #     continue

                # c.add(nums[k])

                # print(nums[i], "+", nums[j], "+", nums[k], "=", (nums[i] + nums[j] + nums[k]))

                if nums[i] + nums[j] + nums[k] == 0:
                    temp = sorted([nums[i], nums[j], nums[k]])
                    if temp not in res:
                        res.append(temp)

    return res


